def convert_to_marker_pos(action):
    return_list = []
    i = 0
    for entry in action:
        if entry != 0:
            return_list.append(i)
        i += 1
    return return_list


def point_average(data, n):
    newdata = []
    i=0
    while i<len(data):
        average_of_n_block = np.median(data[i:i+n])
        newdata.append(average_of_n_block)
        i+=n
    return newdata


def get_avg_after_convergence(list, start):
    return sum(list[start:])/len(list[start:])


